import React from 'react'
import NdPage from './2ndPage.js'
import NameForm from './NameForm.js'

export default class Page1 extends React.Component {

    render(){
        console.log("test with isloggedin : "+props.isLoggedIn)
        if(this.props.isLog === true){
            console.log("Affichage ndpage : "+props.isLoggedIn)

            return <NdPage/>;
        }
        return <NameForm onUpdate={props.onUpdate}/>;
    }

}
